// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract setBet{
    // market za pitanja da/ne
    address payable betCreator;
    uint dateOfResolve; // pogledaj manipulaciju sa datumima
    uint endTime; // vreme do kog traje trziste
    string public myPrediction; //predvidjanje na koje kreator stavlja rep, posto je da/ne
    string category; //kategorija kojoj pripada pitanje, sport, ...
    string tags; // tagovi, ovo mozda i izbacim
    address designetedReporter; // adresa koja po isteku opklade treba da prijavi rezultat
    string additionalDetails;    //pokazuje na kom sajtu ce biti objavljena resenja
    uint creatorFee; // koliko je fee ako trziste prodje kao invalid
    uint initialLiquidity; // ako se ne postavi, filtrira se kao invalid odmah od samog augura
    bool public betFinished;
    enum Vote {YES, NO}
    bool TWOset = false;
    Vote TentativeWinningOutcome;
    string predictionOutcome;
    uint noShowBond; //zalog da ce designeted reporter da prijavi ispravno resenje
    uint validityBond; //zalog da ce outcome biti validan
    mapping(Vote => uint) public listOfBets; // pokazuje koliko je novca na svaki odgovor stavljeno
    mapping(address => mapping(Vote => uint)) public listOfParticipans; // prestavlja listu ucesnika i kolicinu novca koju su ulozili
    mapping(Vote => uint) public listOfREPBets; // pokazuje koliko rep novca je stavljeno 
    mapping(address => mapping(Vote => uint)) public listOfREPreporters; // ljudi koji donose odluku koji odgovor je tacan
    struct betting{ 
    uint sheres;
    uint numberOfEthar;
    bool hasOpponent;
    }
    struct selling{
        uint sheres;
        uint sellingPrice;
    }
    uint betsFor;
    uint betsAgainst;
    mapping(address => betting) public ledgerBookBuy;
    mapping(address => betting) public ledgerBookSell;
    mapping(address => selling) public ledgerBookSelles;
    mapping(address => selling) public ledgerBookSettlment;
    //betting treba da bude dinamicki alociran niz
    //pa ako korisnik kupuje nove deonice
    //da se niz prosiruje
    //adresa kljuc koja pokazuje na   
    // na strukturu u kojoj upisujemo koliko deonica smo kupili po kojoj ceni


    //trebaju mi dve knjige
    //prva koja ce sluziti da kupujes odnosno prodajes ako ti se svidja sa nekim
    // druga je ako zelis da prodas svoje koje posedujes vec
    

    //mozda kreator treba da bude u konstruktoru
    function writePrediction(string memory  Prediction) public {
        myPrediction = Prediction;
    }
    function readPrediction() public view returns (string memory) {
        return myPrediction;
    }
    //takodje moze samo jednom da se pozove
    //korisnik je i designeted reporter, jer ljudi 
    //skoro pa uvek biraju sebe
    function setCreator() public{
        betCreator=msg.sender;
        designetedReporter = msg.sender;
    }
    function getCreator() public view returns(address){
        return betCreator;
    }
    //najbolja opcija je da izabere sebe
   // function setDesignatedReporter(address DesignetedReporter) public{
    //    designetedReporter=DesignetedReporter;
   // }
   // function getDesignatedReporter() public view returns(address){
    //    return designetedReporter;
   // }
    function setCategory() public returns (string memory Category) {
        category = Category;
    }
    function setTags() public returns (string memory Tags) {
        tags = Tags;
    }
   function setAdditionalDetails(string memory AdditionalDetails) public{
        additionalDetails = AdditionalDetails;
    }
    function setEndTime(uint EndTime) public{
        endTime = EndTime;
    }
    function setCreatorFee(uint CreatorFee) public{
        creatorFee = CreatorFee;
    }
    function setInitialLiquidity(uint intLiq) public{
        initialLiquidity = intLiq;
    }
    //koristi se external, a ne public, jer public trosi vise gasa
    //kada kazem yes
    function setParticipantBetBuy(uint Shares) external payable{ 
        //uslov da vreme nije isteklo
        require(betFinished == false, "Voting is over");

        ledgerBookBuy[msg.sender].sheres = Shares; 
        ledgerBookBuy[msg.sender].numberOfEthar = msg.value;
        ledgerBookBuy[msg.sender].hasOpponent= false;
        //upisao korisnika u knjigu, koliko deonica zeli, po kojoj ceni,
        //kada na ovaj nacin upise deonica, nema protivnika
        //i protivnikova adresa ne postoji
      //  listOfBets[ _vote] += msg.value;   // globalna lista opklada
       // listOfParticipans[msg.sender] [_vote] += msg.value; // pojedinacna lista opklada
    }
    // uint proba;
    //     function setProba() external payable{ 
    //         proba = msg.value;
    // }
    //     function getProba() public view returns(uint value){
    //     return proba;
    // }
    function getParticipantBetBuy() public view returns(uint value){
        return ledgerBookBuy[msg.sender].numberOfEthar;
    }
    //kada se ne slazem sa opkladom, ne
    function setParticipantBetSell(uint Shares) external payable{ 
        //uslov da vreme nije isteklo
        require(betFinished == false, "Voting is over");
        
        ledgerBookSell[msg.sender].sheres = Shares; 
        ledgerBookSell[msg.sender].numberOfEthar = msg.value;
        ledgerBookSell[msg.sender].hasOpponent= false;
        //upisao korisnika u knjigu, koliko deonica zeli, po kojoj ceni,
        //kada na ovaj nacin upise deonica, nema protivnika
        //i protivnikova adresa ne postoji
        //listOfBets[ _vote] += msg.value;   // globalna lista opklada
        //listOfParticipans[msg.sender] [_vote] += msg.value; // pojedinacna lista opklada
    }
        function getParticipantBetSell() public view returns(uint value){
        return ledgerBookSell[msg.sender].numberOfEthar;
    }
    //protivnik se slaze sa opkladom,
    //ja se ne slazem sa opkladom
    function setParticipantBetOpponentBuy(address _opponent, uint shere) external payable{ 
        //uslov da vreme nije isteklo
        require(betFinished == false, "Voting is over");
        // ledgerBookBuy[_opponent] = betting(shere, value, true); 
        // ledgerBookSell[msg.sender] = betting(shere, msg.value, true); 
        ledgerBookBuy[_opponent].hasOpponent = true;
        ledgerBookSell[msg.sender] = betting(shere, msg.value, true); 
        betsFor += ledgerBookBuy[_opponent].numberOfEthar;
        betsAgainst += msg.value;
        // ledgerBookBuy[_opponent] = betting(shere, value, true, msg.sender); 
        // ledgerBookSell[msg.sender] = betting(shere, msg.value, true, _opponent); 
        // postavio da postoji opklada izmedju dva bettera
        // onaj ko izgubi, prosledjuje novac onom koji pobedi
    }
    //ja se slazem sa opkladom
    //protivnik se ne slaze
    function setParticipantBetOpponentSell(address _opponent, uint shere) external payable{ 
        //uslov da vreme nije isteklo
        require(betFinished == false, "Voting is over");
          ledgerBookSell[_opponent].hasOpponent = true; 
          ledgerBookBuy[msg.sender] = betting(shere, msg.value, true); 
          betsFor += msg.value;
          betsAgainst += ledgerBookBuy[_opponent].numberOfEthar;
        // onaj ko izgubi,treba da prosledi novac onome ko pobedi 
        // ta funkcija tek treba da se napravi
    }
    // function getParticipantBetSellOpponentAddress() public view returns(address){
    //     return ledgerBookSell[msg.sender].opponentAddress;
    // }
    // funkcija za prikaz podataka ako zelim da prodam deonice
    function setToSellBuy(uint sheres, uint sellingPrice) external{
        require(betFinished == false, "Voting is over");
        require(ledgerBookBuy[msg.sender].sheres >= sheres, "You dont own that much sheres");
        require(ledgerBookBuy[msg.sender].hasOpponent == true, " You have opponent");
        ledgerBookSelles[msg.sender].sheres = sheres;
        ledgerBookSelles[msg.sender].sellingPrice = sellingPrice;
    }
    function getsetToSellBuy() public view returns(uint){
        return ledgerBookSelles[msg.sender].sellingPrice;
    }
    function setToSellSell(uint sheres, uint sellingPrice) external{
        require(betFinished == false, "Voting is over");
        require(ledgerBookSell[msg.sender].sheres >= sheres, "You dont own that much sheres");
        require(ledgerBookSell[msg.sender].hasOpponent == true, " You have opponent");
        ledgerBookSelles[msg.sender].sheres = sheres;
        ledgerBookSelles[msg.sender].sellingPrice = sellingPrice;
    }
    //obrisi na kraju
    mapping(address => uint) recipientEther;
    function buySomeonesBuyBet(address payable _seller) external payable{ 
        //uslov da vreme nije isteklo
        require(betFinished == false, "Voting is over");
           ledgerBookBuy[msg.sender].sheres += ledgerBookBuy[_seller].sheres;
           ledgerBookBuy[msg.sender].numberOfEthar += msg.value;
           ledgerBookBuy[msg.sender].hasOpponent = ledgerBookBuy[_seller].hasOpponent; 
           _seller.transfer(msg.value);
           recipientEther[_seller] = msg.value;
           //kako ga izvrisati sa liste
           ledgerBookSelles[_seller].sheres = 0;
           ledgerBookSelles[_seller].sellingPrice = 0;
    }
    //radi
    function getSellersMoney(address _seller) public view returns(uint){
        return recipientEther[_seller];
    }
       function buySomeonesBuySell(address payable _seller) external payable{ 
        //uslov da vreme nije isteklo
        require(betFinished == false, "Voting is over");
           ledgerBookSell[msg.sender].sheres += ledgerBookBuy[_seller].sheres;
           ledgerBookSell[msg.sender].numberOfEthar += msg.value;
           ledgerBookSell[msg.sender].hasOpponent = ledgerBookBuy[_seller].hasOpponent;
           _seller.transfer(msg.value);
            ledgerBookSelles[_seller].sheres = 0;
           ledgerBookSelles[_seller].sellingPrice = 0;
        // postavio da postoji opklada izmedju dva bettera
        // onaj ko izgubi,treba da prosledi novac onome ko pobedi 
        // ta funkcija tek treba da se napravi
    }
    // sa ove dve funkcije u knjigu postavljamo
    // deonice koje zelimo da prodamo i da za uzvrat od trzista dobijemo novac
    // moramo da pronadjemo korisnika koji zeli da proda njegov deo
    function settleCompleteSetBuy(uint sheres, uint sellingPrice) external{
        require(betFinished == false, "Voting is over");
        require(ledgerBookBuy[msg.sender].sheres >= sheres, "You dont own that much sheres");
        require(ledgerBookBuy[msg.sender].hasOpponent == true, " You have opponent");
        ledgerBookSettlment[msg.sender].sheres = sheres;
        //sellingPrice treba da bude broj izmedju 0 i 10 ne ukljucujuci te brojeve
        ledgerBookSettlment[msg.sender].sellingPrice = sellingPrice;
    }
    function getsettleCompleteSetBuy() public view returns(uint){
        return ledgerBookSettlment[msg.sender].sheres;
    }
    function settleCompleteSetSell(uint sheres, uint sellingPrice) external{
        require(betFinished == false, "Voting is over");
        require(ledgerBookSell[msg.sender].sheres >= sheres, "You dont own that much sheres");
        require(ledgerBookSell[msg.sender].hasOpponent == true, " You have opponent");
        ledgerBookSettlment[msg.sender].sheres = sheres;
        ledgerBookSettlment[msg.sender].sellingPrice = sellingPrice;
    }

    function buySomeonesSettleCompleteSetBuy(address payable _seller, address payable _buyer) external payable{ 
        //uslov da vreme nije isteklo
        require(betFinished == false, "Voting is over");
            //treba da adresama posaljemo novac
            //koliko ethara treaba da dobije yes glasac, no glasac i creator
            //delim sa 10^18 da bih dobio vrednost u wei-ma
            uint price = ledgerBookSettlment[_seller].sheres * (ledgerBookSettlment[_seller].sellingPrice * 10**17);
            //samo za proveru
            recipientEther[_seller] = price;
            //
            //posalje se cena umanjena za creator fee selleru
            uint creatorPart = (price/100)*creatorFee;
            uint realPrice = price - creatorPart; 
            _seller.transfer(realPrice);
            betsFor = betsFor - price;
            // vrednost koju dobija msg.sender
            uint price2 = ledgerBookSettlment[_seller].sheres * ((10-ledgerBookSettlment[_seller].sellingPrice) * 10**17);
            uint creatorPart2 = (price2/100)*creatorFee;
            //samo za proveru
            realPrice = price2;
            recipientEther[_buyer] = realPrice;
            //
            uint diff =  betsAgainst - price2;
            betsAgainst = betsAgainst - price2;
            realPrice = price2 - creatorPart2;
            msg.sender.transfer(price2);
            //kreatoru se poslao njegov deo
            uint creatorMoney = creatorPart + creatorPart2;
            betCreator.transfer(creatorMoney);
            //kako ga izvrisati sa liste
            ledgerBookBuy[_seller].sheres -= ledgerBookSettlment[_seller].sheres;
            //ovaj deo za ethar nam nije potreban
            //njega cu da obrisem
            ledgerBookSell[msg.sender].sheres -= ledgerBookBuy[_seller].sheres;
            ledgerBookSettlment[_seller].sheres = 0;
            ledgerBookSettlment[_seller].sellingPrice = 0;
    }
    function buySomeonesSettleCompleteSetSell(address payable _seller) external payable{ 
        //uslov da vreme nije isteklo
        require(betFinished == false, "Voting is over");
           ledgerBookBuy[msg.sender].sheres -= ledgerBookSettlment[_seller].sheres;
           ledgerBookSell[_seller].sheres -= ledgerBookBuy[_seller].sheres;
           //treba da adresama posaljemo novac
            //koliko ethara treaba da dobije yes glasac, no glasac i creator
            //delim sa 10^18 da bih dobio vrednost u wei-ma
            uint price = ledgerBookSettlment[_seller].sheres * (ledgerBookSettlment[_seller].sellingPrice * 10^17);
            //posalje se cena umanjena za creator fee selleru
            uint creatorPart = (price/100)*creatorFee;
            uint realPrice = price - creatorPart; 
            _seller.transfer(realPrice);
            betsAgainst = betsAgainst - price;
            // vrednost koju dobija msg.sender
            price = ledgerBookSettlment[_seller].sheres * ((10 - ledgerBookSettlment[_seller].sellingPrice) * 10^17);
            uint creatorPart2 = (price/100)*creatorFee;
            realPrice = price - creatorPart2;
            betsFor = betsFor - price;
            msg.sender.transfer(realPrice);
            //kreatoru se poslao njegov deo
            uint creatorMoney = creatorPart + creatorPart2;
            betCreator.transfer(creatorMoney);
            ledgerBookSettlment[_seller].sheres = 0;
            ledgerBookSettlment[_seller].sellingPrice = 0;
    }
    function setValidityBond() external payable{ 
        //treba da se pozove samo jednom, uslov je da creator mora da plati
        // validity bond, kreator placa odredjenu svotu novca
        // dobija je nazad ako je outcome valid
         require(betCreator == msg.sender);
         //potrebno je da se odredi neka fiksna vrednost
         validityBond = msg.value;
    }
    function getValidityBond() public payable returns (uint) { 
        // funkcija koja vraca novac creatoru ako
        // je outcome validan
        require(betFinished == true, "Voting is over");
        require(betCreator == msg.sender);
        require(betCreator == msg.sender);
      //  require(predictionOutcome == "valid");
        msg.sender.transfer(validityBond);
    }
    function setNoShowBond() external payable{ 
        //treba da se pozove samo jednom, uslov je da creator mora da plati
         require(betCreator == msg.sender);
         //potrebno je da se odredi neka fiksna vrednost
         noShowBond = msg.value;
    }
    function setPredictionOutcame(Vote _vote) external payable{  //pobednik je ko ima vise novca u ovoj listi
        //uslov da vreme nije isteklo
        require(betFinished == false, "Voting is over");
        listOfREPBets[ _vote] += msg.value;   // globalna lista opklada
        listOfREPreporters[msg.sender] [_vote] += msg.value; // pojedinacna lista opklada
    }
    function setTentativeWinningOutcome(Vote _vote) external {  //kreator treba da postavi ko je pobedio 
        //uslov je da je vreme isteklo
        require(betFinished == true, "Voting is over");
        require(msg.sender == designetedReporter, "Right designeted reporter");
        //ako je proslo tri dana, gubi se rep koji je postavio creator trzista
        TentativeWinningOutcome = _vote;
        TWOset = true;
    }
    // ako prodje odredjen period i nije postavljen rezultat treba napraviti funkciju
    // da jedna osoba moze da postavi rezultat ko god to bio
    // i on dobija no show bond   
    function setOpenReporting(Vote _vote) external {  
        //ako kreator ne postavi ko je pobedio u odredjenom roku 
        //uslov je da je vreme isteklo
        //betFinished + odredjeno vreme, tri dana
        require(betFinished == true, "Voting is over");
        require(TWOset == false, "There is no tentative winning outcome");
        TentativeWinningOutcome = _vote;
        msg.sender.transfer(noShowBond);
        TWOset = true;
    }
    function getTentativeWinningOutcome() public view returns (Vote) { // funkcija koja prikazuje ko je pobednik
        require(betFinished == true, "Voting is over");
        return TentativeWinningOutcome;
    }
    //dodaj validity bond
    //korisnik moze da kupi(postavi) opkladu tako sto plati ethar ili tako sto kupi necije opklade
    function buyParticipantBet() external payable{ 
        //uslov da vreme nije isteklo
        require(betFinished == false, "Voting is over");
        // treba poslati osobi od koje zelim da kupim opkladu novac, 
        // i od nje dobijam njegovu opkladu
        // njegov shere
        //listOfParticipans[msg.sender] [_vote] += msg.value; // pojedinacna lista opklada
        //listOfBets[ _vote] += msg.value;   // globalna lista opklada
    }
    //smisli bolji naziv
    //treba dodati ko je izgubio
    function getMoney() external{
        require(betFinished == true, "Betting is over");
       // require(predictionOutcome == "valid", "Outcome of prediction market is valid");
        uint myBet = listOfParticipans[msg.sender][TentativeWinningOutcome];
        //uint gain = myBet + listOfBets[loser] * myBet / listOfBets[winner];
    }
}
